import React from 'react';
class ListarPokemon extends  React.Component {
    constructor(props){
        super(props);

        this.state = {
            content: ''
        }
    }

    render() {
        if(this.props.encontrado){
            this.props.resultado
                .results.map( (pokemon) => {
                    return(
                        <div>
                            <h3>{pokemon.name}</h3>
                            <h4>{pokemon.id}</h4>
                            <img src = {pokemon.sprites.front_default} />
                        </div>
                    );
                });
        }
        return(
            <div>
            </div>
        );
    };

}
export default ListarPokemon;
